DROP TABLE IF EXISTS `course_items`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `course_items` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `parent_id` bigint unsigned DEFAULT NULL,
  `level` int NOT NULL DEFAULT '1',
  `is_leaf` tinyint(1) NOT NULL DEFAULT '1',
  `fee` decimal(15,2) NOT NULL DEFAULT '0.00',
  `order_index` int NOT NULL DEFAULT '0',
  `is_special` tinyint(1) NOT NULL DEFAULT '0',
  `learning_method` enum('online','offline') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Phương thức học: online (trực tuyến) hoặc offline (trực tiếp). Chỉ áp dụng cho khóa học cuối cùng (is_leaf = true)',
  `custom_fields` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin,
  `status` enum('active','completed') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'active',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `course_items_parent_id_foreign` (`parent_id`),
  CONSTRAINT `course_items_parent_id_foreign` FOREIGN KEY (`parent_id`) REFERENCES `course_items` (`id`) ON DELETE CASCADE,
  CONSTRAINT `course_items_chk_1` CHECK (json_valid(`custom_fields`))
) ENGINE=InnoDB AUTO_INCREMENT=144 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
