DROP TABLE IF EXISTS `enrollments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `enrollments` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `student_id` bigint unsigned NOT NULL,
  `course_item_id` bigint unsigned DEFAULT NULL,
  `enrollment_date` date NOT NULL,
  `status` varchar(191) NOT NULL DEFAULT 'pending',
  `request_date` timestamp NULL DEFAULT NULL,
  `confirmation_date` timestamp NULL DEFAULT NULL,
  `last_status_change` timestamp NULL DEFAULT NULL,
  `cancelled_at` timestamp NULL DEFAULT NULL,
  `previous_status` varchar(191) DEFAULT NULL,
  `discount_percentage` decimal(5,2) NOT NULL DEFAULT '0.00',
  `discount_amount` decimal(15,2) NOT NULL DEFAULT '0.00',
  `final_fee` decimal(15,2) NOT NULL,
  `notes` text,
  `custom_fields` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `enrollments_student_id_course_item_id_unique` (`student_id`,`course_item_id`),
  KEY `enrollments_course_item_id_foreign` (`course_item_id`),
  CONSTRAINT `enrollments_course_item_id_foreign` FOREIGN KEY (`course_item_id`) REFERENCES `course_items` (`id`) ON DELETE CASCADE,
  CONSTRAINT `enrollments_student_id_foreign` FOREIGN KEY (`student_id`) REFERENCES `students` (`id`) ON DELETE CASCADE,
  CONSTRAINT `enrollments_chk_1` CHECK (json_valid(`custom_fields`))
) ENGINE=InnoDB AUTO_INCREMENT=960 DEFAULT CHARSET=utf8mb3;
